import React from 'react';

const ProductBlock = ({products, type, removeItem}) => {
	const renderItems = () => (
		products.cartDetails ?
			products.cartDetails.map(products => (
				<div key={products._id} className='user_product_block'> 
					{ products._id }
				</div>

			))
		: null
	)

	return (
	    <div>
	      { renderItems() }
	    </div>

	)
}
export default ProductBlock;
